import React from "react";

import { Container, Row, Col } from "client/reusecore/Layout";
import Box from "client/reusecore/Box";
import Heading from "client/reusecore/Heading";
import Text from "client/reusecore/Text";
import Button from "client/reusecore/Button";
import Input from "client/reusecore/Form/Input";
import { SectionTitle } from "client/reusecore/SectionTitle";

import SubscribeWrapper from "./subscribe.style";

const Subscribe = () => {
  return (
    <SubscribeWrapper id="contact">
      <Container>
        <Row>
          <Col className="col-12">
            <Box className="subscribe-box-bg">
              <Row>
                <Col className="lg-6 offset-lg-3 xs-12">
                  <SectionTitle>
                    <Heading> Donâ€™t miss out, Stay updated </Heading>
                    <Text>
                      Sign up for updates and market news. Subscribe to our
                      newsletter and receive update about ICOs and crypto tips.
                    </Text>
                  </SectionTitle>
                </Col>
              </Row>
              <Row>
                <Col className="lg-8 offset-lg-2 xs-12">
                  <Box className="form-box">
                    <Input
                      type="text"
                      placeholder="Enter your email address . . ."
                    />
                    <Button>Subscribe</Button>
                  </Box>
                </Col>
              </Row>
            </Box>
          </Col>
        </Row>
      </Container>
    </SubscribeWrapper>
  );
};

export default Subscribe;
